Exercise 2: Create a simple React app
First you'll need to create a simple React app. You'll not need Redux or any other similar library at the moment. Create React App boilerplate should be enough.
Task
Create a simple React app using Create React App and add the following few pages to it:

List of all meetups page (home page)
Meetup details page
Add a new meetup page
Edit the meetup page

All pages can have just a title, as you'll add more elements in the next exercise.
Hints

You can use Create React App to generate the app.
Use the npx command if you don't want to install Create React App locally.
You can use React Router to add navigation for these four pages.

Need more help?
Run the following command to create a new React application using Create React App:
npx create-react-app meetup-frontend

Then navigate to your new meetup-frontend folder and install React Router by running the following command:
npm install react-router-dom -S

Finally, modify the src/App.js file to look similar to the following code snippet:
Show code
import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

function Meetups() {
  return List meetups;
}

function SingleMeetup() {
  return Show single meetup;
}

function AddMeetup() {
  return Add a meetup;
}

function UpdateMeetup() {
  return Update a meetup;
}

function AppRouter() {
  return (




            All meetups
            Single meetup
            Add a meetup
            Update a meetup









  );
}

export default AppRouter;


This is not the best code ever, but it'll do the trick.

exercises/EXERCISE-03-07.html.body:
Exercise 7: Connect mutations
Now that you have your GraphQL backend, you'll need to add some data to it. You can start with a few mutations and queries directly in AWS Web Console. But eventually you want to connect your frontend app with your GraphQL backend.
Task
Connect createMeetup, updateMeetup and deleteMeetup mutations with your React application.
Hints

Amplify and AppSync generated following three mutations for your Meetup model:createMeetup(input: CreateMeetupInput!): Meetup
  updateMeetup(input: UpdateMeetupInput!): Meetup
  deleteMeetup(input: DeleteMeetupInput!): Meetup


You can see the details for all mutations in AWS Web Console. Navigate to AppSync (here's a direct link: link), select your AppSync project (it should be named meetup or something similar) and select "Schema" from the menu on the right.
You can use the following line to import React libs that allows you to talk to your GraphQL backend:import { API, graphqlOperation } from 'aws-amplify';

and this for importing mutations:import { createMeetup as CreateMeetup } from './graphql/mutations'


See the documentation for more examples: https://aws-amplify.github.io/docs/js/api#mutations.

Need more help?
Your createMeetup mutation can look like this:
import Amplify, { API, graphqlOperation } from 'aws-amplify';
import { createMeetup as CreateMeetup } from './graphql/mutations';

// Mutation
const meetupDetails = {
  name: 'Meetup #25 - GraphQL with Amplify',
  group: 'JS Belgrade',
  date: '2019-10-19',
  startTime: '18:00',
  endTime: '20:00',
  location: 'ICT Hub, Kralja Milana 10, Belgrade, Serbia',
  description: 'Long form description'
};

const newMeetup = await API.graphql(graphqlOperation(CreateMeetup, {input: meetupDetails}));
console.log(newMeetup);

To integrate this with your React app, make sure you invoke this line when you create a new meetup, and pass the data from the form as meetupDetails:
const newMeetup = await API.graphql(graphqlOperation(CreateMeetup, {input: meetupDetails}));

Similar will work for update and delete, with a small difference: delete only requires an ID.

exercises/EXERCISE-03-09.html.body:
Exercise 9: Real-time subscriptions
There's one more amazing thing you get out-of-the-box with Amplify: real-time updates. This mean you don't need to refresh the page and you'll be able to see new meetups as they are added. Let's try to do that!
Task
Subscribe to all mutations and update the list of meetups in real-time when some change occurs.
Hints

See the documentation for the details: https://aws-amplify.github.io/docs/js/api#subscriptions.
Amplify and AppSync generated the following three subscriptions for you:

onCreateMeetup
onUpdateMeetup
onDeleteMeetup

See your project schema in AWS Web Console > AppSync for more details.


Need more help?
You can integrate a subscription by doing something similar to the following code snippet:
// import the subscription
import { onCreateMeetup } from './graphql/subscriptions'

// subscribe in componentDidMount
API.graphql(
  graphqlOperation(onCreateMeetup)
).subscribe({
    next: (eventData) => {
      console.log('eventData', eventData)
      const updatedMeetup = eventData.value.data.onCreateMeetup
      const meetups = [
        ...this.state.meetups.filter(meetup => {
          return meetup.id !== updatedMeetup.id
        }),
        updatedMeetup
      ]
      this.setState({ meetups })
    }
});

