Exercise 10: Upload images (BONUS)
Meetups sometimes can have some images. For example, someone will add a custom social media sharing image, or simply a sponsor logo. Is that something Amplify can do for us? Well, as you can guess...
Task
Allow users to upload an image when creating the meetup, than show that image on a meetup details page.
Hints

Check the amplify add storage command.
See the documentation for more details: https://aws-amplify.github.io/docs/js/storage.

Need more help?
Ok, let's the one last hint for today :)
Run the amplify add storage command to add storage. Then add "Content (Images, audio, video, etc.)" type of the storage and answer the remaining questions (default answers will work just fine).
Once you finish your setup, run amplify push to deploy all changes to your AWS account, and you'll be ready to integrate storage to your React app.
To do so, you'll need something similar to this code snippet:
class S3ImageUpload extends React.Component {
  onChange(e) {
    const file = e.target.files[0];
    Storage.put('example.png', file, {
      contentType: 'image/png'
    })
      .then (result => console.log(result))
      .catch(err => console.log(err));
  }

  render() {
    return (
       this.onChange(e)}
      />
    )
  }
}

P.S. To update your GraphQL schema, edit the "amplify/backend/api/meetup/schema.graphql" file (make sure you put your project name instead of "meetup"), and the run the following command:
amplify api update
